import React from 'react';

const ReviewList = ({ reviews }) => {
  return (
    <div className="review-list">
      {reviews.map((review, index) => (
        <div key={index} className="review-item">
          <p>{review.review}</p>
          <p>Rating: {review.rating} Stars</p>
        </div>
      ))}
    </div>
  );
};

export default ReviewList;
